	// Bluetooth
	_renderRow(rows) {
		let items = [];
		for (let i in rows) {
			let row = rows[i];
			if (row.address) {
				items.push(
					<TouchableOpacity
						key={new Date().getTime() + i}
						style={styles.wtf}
						onPress={() => {
							this.setState({
								loading: true,
							});
							BluetoothManager.connect(row.address).then(
								s => {
									this.setState({
										loading: false,
										boundAddress: row.address,
										name: row.name || 'UNKNOWN',
									});
								},
								e => {
									this.setState({
										loading: false,
									});
									Alert.alert('Oops!', e);
								},
							);
						}}
					>
						<Text style={styles.name}>{row.name || 'UNKNOWN'}</Text>
						<Text style={styles.address}>{row.address}</Text>
					</TouchableOpacity>,
				);
			}
		}
		return items;
	}

	_scan() {
		this.setState({
			loading: true,
		});
		BluetoothManager.scanDevices().then(
			s => {
				var ss = s;
				var found = ss.found;
				try {
					found = JSON.parse(found); //@FIX_it: the parse action too weired..
				} catch (e) {
					//ignore
				}
				var fds = this.state.foundDs;
				if (found && found.length) {
					fds = found;
				}
				this.setState({
					foundDs: fds,
					loading: false,
				});
			},
			er => {
				this.setState({
					loading: false,
				});
				Alert.alert('Oops!', 'error' + JSON.stringify(er));
			},
		);
	}
